import React from 'react'

const RegisterPage = () => {
    return (
        <>
            <h1>Register</h1>
            <form type="text" className="input" name = "name"></form>
            <form type="email" className="input" name = "email"></form>
            <form type="password" obscured className="input" name = "password"></form>
        </>
    )
}

export default RegisterPage
